import React from 'react'
import OrderTable from './components/OrderTable'
import items from './data/items'


function OrderPage(){
    return(
        <>
            <h1>Order Page</h1>
            <OrderTable orders={items}></OrderTable>
        </>
    )

}


export default OrderPage;
